import './Home.css'

function Home() {
  return (
    <div className='home'>
        <div className='home__container'> <img src='https://www.x-cart.com/wp-content/uploads/2019/01/ecommerce-768x278.jpg' alt='' className='home__image'></img> </div>
    </div>
  )
}

export default Home
